// src/App.js
import React, { useState, useEffect } from 'react';

function App() {
  const [produse, setProduse] = useState([]);
  const [filters, setFilters] = useState({
    denumire: '',
    substanta: '',
    categorie: '',
    cultura: '',
    daunator: ''
  });
  const [error, setError] = useState(null);

  const fetchProduse = async () => {
    try {
      // reconstruim query-string-ul
      const params = new URLSearchParams();
      Object.entries(filters).forEach(([key, value]) => {
        if (value.trim()) {
          params.append(key, value.trim());
        }
      });

      // DEBUG: ce URL trimitem?
      console.log('🕵️ fetchProduse url:', `/produse/cautare?${params.toString()}`);

      const res = await fetch(`/produse/cautare?${params.toString()}`);
      if (!res.ok) throw new Error(`Server responded ${res.status}`);
      const data = await res.json();
      setProduse(data);
      setError(null);
    } catch (err) {
      console.error(err);
      setError(err.message || 'Eroare la fetch');
    }
  };

  // apel iniţial
  useEffect(() => {
    fetchProduse();
  }, []);

  const handleFilterChange = e => {
    const { name, value } = e.target;
    setFilters(prev => ({ ...prev, [name]: value }));
  };

  const handleSearch = e => {
    e.preventDefault();
    fetchProduse();
  };

  return (
    <div className="App">
      {error && <div className="error">ERROR: {error}</div>}

      <h1>Produse Fitosanitare</h1>

      <form onSubmit={handleSearch} className="filters">
        <input
          type="text"
          name="denumire"
          placeholder="Denumire"
          value={filters.denumire}
          onChange={handleFilterChange}
        />
        <input
          type="text"
          name="substanta"
          placeholder="Substanță"
          value={filters.substanta}
          onChange={handleFilterChange}
        />
        <input
          type="text"
          name="categorie"
          placeholder="Categorie"
          value={filters.categorie}
          onChange={handleFilterChange}
        />
        <input
          type="text"
          name="cultura"
          placeholder="Cultură"
          value={filters.cultura}
          onChange={handleFilterChange}
        />
        <input
          type="text"
          name="daunator"
          placeholder="Dăunător"
          value={filters.daunator}
          onChange={handleFilterChange}
        />
        <button type="submit">Caută</button>
      </form>

      <table>
        <thead>
          <tr>
            <th>Denumire</th>
            <th>Substanțe active</th>
            <th>Categorie</th>
            <th>Culturi</th>
            <th>Dăunători</th>
          </tr>
        </thead>
        <tbody>
          {produse.map(p => (
            <tr key={p.id || p.denumire_produs}>
              <td>{p.denumire_produs}</td>
              <td>
                {[p.substanta_activa_1, p.substanta_activa_2, p.substanta_activa_3, p.substanta_activa_4]
                  .filter(Boolean)
                  .join(', ')}
              </td>
              <td>{p.categorie_produs}</td>
              <td>{p.culturi_omologate}</td>
              <td>{p.daunatori_omologati}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
